(function($) {

    $("#account-summary-toggler, #account-summary-hide-toggler").on('click', function(e){
        e.preventDefault();
        $("#account-summary").slideToggle();
        $("#account-summary-toggler").toggle();
        $("#account-summary-hide-toggler").toggle();
    });

    $("#pay-invoice, #see-invoice-details").on('click', function(e){
        e.preventDefault();
        $("#pay-invoice").toggle();
        $("#see-invoice-details").toggle();
        $("#checkout-form").toggle();
        $("#invoice-checkout-content").toggle();
    });

    $('[data-toggle="tooltip"]').tooltip();

    var clipboard = new Clipboard('.copy-btn');

    clipboard.on('success', function(e) {
        $(e.trigger).next('.copied-notifier').show().delay(1000).fadeOut('slow');
        e.clearSelection();
    });

    $('[data-toggle="tooltip"]').tooltip();

})(jQuery);

jQuery(function () {

    var larail = {

        // Define the name of the hidden input field for method submission
        methodInputName: '_method',
        // Define the name of the hidden input field for token submission
        tokenInputName: '_token',
        // Define the name of the meta tag from where we can get the csrf-token
        metaNameToken: 'csrf-token',

        initialize: function()
        {
            $('a[data-pd-method]').on('click', this.handleMethod);
        },

        handleMethod: function(e)
        {
            e.preventDefault();

            var link = $(this),
                httpMethod = link.data('pd-method').toUpperCase(),
                confirmMessage = link.data('pd-confirm'),
                form;

            // Exit out if there is no data-methods of PATCH, PUT or DELETE.
            if ($.inArray(httpMethod, ['POST', 'PATCH', 'PUT', 'DELETE']) === -1)
            {
                return;
            }

            // Allow user to optionally provide data-confirm="Are you sure?"
            if (confirmMessage)
            {
                swal({
                  title: "Êtes-vous sûr?",
                  text: confirmMessage,
                  type: "warning",
                  showCancelButton: true,
                  cancelButtonText: "Annuler",
                  confirmButtonColor: "#DD6B55"
                }, function(isConfirm){
                  if(isConfirm) {
                    form = larail.createForm(link);
                    form.submit();
                  }
                });
            } else {
               form = larail.createForm(link);
               form.submit();
            }
        },

        createForm: function(link)
        {
            var form = $('<form>',
                {
                    'method': 'POST',
                    'action': link.prop('href')
                });

            var token = $('<input>',
                {
                    'type': 'hidden',
                    'name': larail.tokenInputName,
                    'value': $('meta[name=' + larail.metaNameToken + ']').prop('content')
                });

            var method = $('<input>',
                {
                    'type': 'hidden',
                    'name': larail.methodInputName,
                    'value': link.data('pd-method')
                });

            return form.append(token, method).appendTo('body');
        }
    };

    larail.initialize();

});

function displayMessage(title, message, type)
{
    swal({
        title: title,
        text: message,
        type: type,
        html: true
    });
}



